import React from 'react';
import BannerProcess from '../components/Banner/BannerProcess';
import ScrumTeam from '../components/Process/ScrumTeam';
import ScrumEvents from '../components/Process/ScrumEvents';
import Designtab from '../components/Process/Designtab';



const Scrum = () => {
    return(
        <div className="body_wrapper">
 
            <BannerProcess 
                Title="Scrum Project Management" 
                TextD="Scrum is an agile development methodology used in the development of Software based on an iterative and incremental processes.  Scrum is adaptable, fast, flexible and effective agile framework that is designed to deliver value to the customer throughout the development of the project."/>            
            <ScrumEvents/>
            <ScrumTeam/>
            <Designtab/>
        </div>
    )
}
export default Scrum;
